import { LoginButton, LoginCard, LoginContainer, LoginInput, LoginTitle } from "./styles";
import { ToastContainer, toast } from "react-toastify";

const Login = () => {
  const login = () => {
    toast("ðŸ¦„ Wow so easy!", {
      position: "top-right",
      autoClose: 5000,
      hideProgressBar: false,
      closeOnClick: true,
      pauseOnHover: true,
      draggable: true,
      progress: undefined,
      theme: "light",
    });

    console.log("AAA");
  };

  return (
    <>
      <ToastContainer />
      <LoginContainer>
        <div>
          <LoginTitle>Football Stats</LoginTitle>
          <LoginCard>
            <LoginInput placeholder="Api Key"></LoginInput>
            <LoginButton onClick={() => login()}>Login</LoginButton>
          </LoginCard>
        </div>
      </LoginContainer>
    </>
  );
};

export default Login;
